import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import Header from "./Header";
import Main from "./Main";
import Article from "./Article";
import Footer from "./Footer";

ReactDOM.render(
  <React.StrictMode>
    <Header />
    <Main />
    <Article />
    <Footer />
  </React.StrictMode>,
  document.getElementById("root")
);
